export default (function(a,b,c,d){return {data:{"6Q4yuVl0Vv":{data:{id:102,attributes:{imdbId:"tt1014759",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTMwNjAxMTc0Nl5BMl5BanBnXkFtZTcwODc3ODk5Mg@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"51%"},{Source:"Metacritic",Value:"53\u002F100"}],item_lang:{data:{id:765,attributes:{title:"Alice in Wonderland",plot:"Alice, an unpretentious and individual 19-year-old, is betrothed to a dunce of an English nobleman. At her engagement party, she escapes the crowd to consider whether to go through with the marriage and falls down a hole in the garden after spotting an unusual rabbit. Arriving in a strange and surreal place called \"Underland,\" she finds herself in a world that resembles the nightmares she had as a child, filled with talking animals, villainous queens and knights, and frumious bandersnatches. Alice realizes that she is there for a reason--to conquer the horrific Jabberwocky and restore the rightful queen to her throne.",slug:"alice-in-wonderland"}}},books:{data:[{id:2134,attributes:{title:b,description:"A little girl falls down a rabbit hole and discovers a world of nonsensical and amusing characters.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zEDDSh8nHwQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:true,published:"2005-01-01",publisher:"Sterling Publishing Company, Inc.",subtitle:a}},{id:2135,attributes:{title:b,description:"A little girl falls down a rabbit hole and embarks on a fantastic journey through Wonderland.",thumbnail:a,authors:["Dalmatian Press","Debbie Guthery",c],firstBook:d,published:"2009-01-15",publisher:a,subtitle:a}},{id:2136,attributes:{title:b,description:"Celebrate 150 years of Alice's Adventures in Wonderland with a pocket-sized piece of history! First published by Macmillan in 1907, Alice's Adventures in Wonderland: Little Folks Edition is a charming miniature edition of Lewis Carroll's classic tale which is specially abridged for younger readers. A sixth of the length of the original 1865 edition, it features 32 brightly coloured illustrations by Sir John Tenniel, uniquely featuring Alice in a red dress. Faithfully reproduced from a rare archive copy, this unique little book retains all the charm of the historic original. With luxurious red Wibalin binding and gold sprayed edges, it is the perfect celebration of Alice's special anniversary; a wonderful gift for fans of every age and a must-have for every collector's bookshelf.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MrOVCwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2015-02-05",publisher:"Pan Macmillan",subtitle:"The Little Folks' Edition"}},{id:2137,attributes:{title:b,description:"A young girl enters two bizarre worlds by following a white rabbit down a rabbit hole and moving through the mirror on the mantel.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=TRwXVxmjaZcC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"1981-01-01",publisher:"Bantam Classics",subtitle:"&, Through the Looking-glass"}},{id:2138,attributes:{title:b,description:"Alice's Adventures in Wonderland (commonly shortened to Alice in Wonderland) is an 1865 fantasy novel written by English mathematician Charles Lutwidge Dodgson under the pseudonym Lewis Carroll. It tells of a girl named Alice falling through a rabbit hole into a fantasy world populated by peculiar, anthropomorphic creatures. The tale plays with logic, giving the story lasting popularity with adults as well as with children. It is considered to be one of the best examples of the literary nonsense genre. Its narrative course and structure, characters and imagery have been enormously influential in both popular culture and literature, especially in the fantasy genre.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=H9noswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Lewis Carrol"],firstBook:d,published:"2018-02-17",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940910702}}("","Alice's Adventures in Wonderland","Lewis Carroll",null))